ต่อไปนี้เป็นโค้ด C++ สำหรับการคำนวณเลข Fibonacci ที่ n โดยใช้การเรียกซ้ำกันเอง (recursion):

```cpp
#include<iostream>
using namespace std;

int fibonacci(int n) {
   if(n <= 1) {
      return n;
   } else {
      return fibonacci(n - 1) + fibonacci(n - 2);
   }
}

int main() {
   int n;
   cout << "Enter the term to find in Fibonacci series: ";
   cin >> n;
   cout << "Fibonacci number at " << n << " position: " << fibonacci(n);
   return 0;
}
```

โปรดทราบว่าการใช้ recursion ในการคำนวณ Fibonacci อาจจะไม่มีประสิทธิภาพสำหรับค่า n ที่ใหญ่ เนื่องจากมันจะทำการคำนวณซ้ำๆ สำหรับค่าที่เคยคำนวณไปแล้ว ถ้าคุณต้องการคำนวณ Fibonacci สำหรับค่า n ที่ใหญ่ คุณอาจต้องการใช้วิธีอื่น เช่น dynamic programming.

ต่อไปนี้เป็นโค้ด C++ สำหรับการคำนวณตัวเลขที่ n ในลำดับที่คุณกำหนด:

```cpp
#include<iostream>
using namespace std;

int sequence(int n) {
   if(n == 0) {
      return 0;
   } else if(n == 1 || n == 2) {
      return -1;
   } else {
      return sequence(n - 1) + sequence(n - 2) + sequence(n - 3);
   }
}

int main() {
   int n;
   cout << "Enter the term to find in the sequence: ";
   cin >> n;
   cout << "Number at " << n << " position: " << sequence(n);
   return 0;
}
```

โปรดทราบว่าการใช้ recursion ในการคำนวณลำดับนี้อาจจะไม่มีประสิทธิภาพสำหรับค่า n ที่ใหญ่ เนื่องจากมันจะทำการคำนวณซ้ำๆ สำหรับค่าที่เคยคำนวณไปแล้ว ถ้าคุณต้องการคำนวณลำดับสำหรับค่า n ที่ใหญ่ คุณอาจต้องการใช้วิธีอื่น เช่น dynamic programming.

ฟังก์ชันนี้มีปัญหาเล็กน้อยที่จุดเริ่มต้นของการวนซ้ำ คุณเริ่มวนซ้ำที่ i = 1 และ j = 1 แต่คุณไม่ได้กำหนดค่าเริ่มต้นสำหรับ dp[i][j] ในกรณีที่ i = 0 หรือ j = 0 ซึ่งอาจทำให้เกิดข้อผิดพลาดเมื่อคุณพยายามอ้างอิง dp[i-1][j-1] หรือ dp[i-1][j] หรือ dp[i][j-1] ในรอบแรกของการวนซ้ำ

คุณสามารถแก้ไขปัญหานี้ได้โดยการกำหนดค่าเริ่มต้นสำหรับ dp[i][j] เมื่อ i = 0 หรือ j = 0 ดังนี้:

```
def longest_common_subsequence(X , Y): 
    m = len(X) 
    n = len(Y) 

    dp = [[0]*(n+1) for i in range(m+1)] 

    for i in range(m+1): 
        for j in range(n+1): 
            if i == 0 or j == 0 :
                dp[i][j] = 0
            elif X[i-1] == Y[j-1]: 
                dp[i][j] = dp[i-1][j-1]+1
            else: 
                dp[i][j] = max(dp[i-1][j], dp[i][j-1]) 

    return dp[m][n]
```

ด้วยการแก้ไขนี้ ฟังก์ชันจะสามารถทำงานได้ถูกต้องและคืนค่าความยาวของลำดับย่อยที่ยาวที่สุดที่สอดคล้องกันระหว่างสตริง X และ Y

ฟังก์ชันที่คุณต้องการจะต้องทำการค้นหาโหนดที่มีค่าสูงสุดที่สามารถเข้าถึงได้จากสองโหนดที่กำหนดให้ ในต้นไม้แบบไบนารี ซึ่งเราสามารถทำได้โดยการใช้การท่องเที่ยวแบบ DFS (Depth-First Search) หรือ BFS (Breadth-First Search) ต่อไปนี้คือฟังก์ชันที่ใช้การท่องเที่ยวแบบ DFS:

```python
class Node:
    def __init__(self, key):
        self.data = key
        self.left = None
        self.right = None

def findMaxPath(root, n1, n2):
    if root is None:
        return None

    if root.data == n1 or root.data == n2:
        return root.data

    left = findMaxPath(root.left, n1, n2)
    right = findMaxPath(root.right, n1, n2)

    if left is not None and right is not None:
        return max(root.data, max(left, right))
    elif left is not None:
        return max(root.data, left)
    else:
        return max(root.data, right)

root = Node(1)
root.left = Node(2)
root.right = Node(3)
root.left.left = Node(4)
root.left.right = Node(5)
root.right.left = Node(6)
root.right.right = Node(7)

print("Maximum value path = ", findMaxPath(root, 4, 5))
```

โปรดทราบว่า ฟังก์ชันนี้จะคืนค่าสูงสุดที่พบในเส้นทางระหว่างสองโหนดที่กำหนด แต่ไม่ได้คืนค่า Lowest Common Ancestor (LCA) ถ้าคุณต้องการค้นหา LCA คุณจะต้องใช้ฟังก์ชันที่แตกต่างกัน.

ฟังก์ชันที่คุณต้องการสามารถสร้างได้ด้วยภาษา Python ดังนี้:

```python
def find_median(sorted_array):
    n = len(sorted_array)
    if n % 2 == 0:
        return (sorted_array[n//2 - 1] + sorted_array[n//2]) / 2
    else:
        return sorted_array[n//2]
```

ฟังก์ชันนี้จะทำงานด้วยความซับซ้อนของเวลา O(1) และความซับซ้อนของพื้นที่ O(n) ตามที่คุณต้องการ โดยที่ n คือขนาดของอาร์เรย์ที่เรียงลำดับแล้ว. ฟังก์ชันนี้จะคืนค่ามัธยฐานของอาร์เรย์ที่เรียงลำดับแล้ว ซึ่งคือค่าที่อยู่ตรงกลางของอาร์เรย์หากขนาดของอาร์เรย์เป็นเลขคี่ หรือค่าเฉลี่ยของสองค่าที่อยู่ตรงกลางของอาร์เรย์หากขนาดของอาร์เรย์เป็นเลขคู่.

ในการหาส่วนใหญ่สองอันดับแรกในอาร์เรย์ คุณสามารถใช้การปรับเปลี่ยนของ Boyer-Moore Voting Algorithm โดยใช้สองตัวแปรสำหรับการนับและสองตัวแปรสำหรับผู้สมัคร ดังนี้:

```python
def majority_elements(nums):
    count1, count2, candidate1, candidate2 = 0, 0, 0, 1
    for n in nums:
        if n == candidate1:
            count1 += 1
        elif n == candidate2:
            count2 += 1
        elif count1 == 0:
            candidate1, count1 = n, 1
        elif count2 == 0:
            candidate2, count2 = n, 1
        else:
            count1, count2 = count1 - 1, count2 - 1
    return [n for n in (candidate1, candidate2)
            if nums.count(n) > len(nums) // 3]
```

ฟังก์ชันนี้จะทำงานโดยการวนลูปผ่านอาร์เรย์ `nums` และใช้ `count1` และ `count2` เพื่อติดตามจำนวนของ `candidate1` และ `candidate2` ตามลำดับ ถ้า `count1` หรือ `count2` ลดลงเป็น 0 เราจะเปลี่ยน `candidate` ใหม่ และในท้ายที่สุด `candidate1` และ `candidate2` ที่เหลืออยู่จะเป็นส่วนใหญ่สองอันดับแรกของอาร์เรย์

โปรดทราบว่า ฟังก์ชันนี้จะทำงานได้ถูกต้องเมื่อมีส่วนใหญ่สองอันดับในอาร์เรย์ ถ้าไม่มีส่วนใหญ่สองอันดับ ผลลัพธ์จะไม่ถูกต้อง ในกรณีนั้น คุณอาจต้องตรวจสอบว่า `candidate1` และ `candidate2` ที่ได้จริงๆ มีส่วนใหญ่หรือไม่โดยการวนลูปผ่านอาร์เรย์อีกครั้งและนับจำนวนของ `candidate1` และ `candidate2`

